Mongo C# - update single field, if not insert document<p>I'm using the C# Mongo driver v2.9.2 in a small project of mine and I'm trying to figure out how I can do an upsert that only updates a single field if a document exists, and if not inserts the entire document.</p>

<p>I have the following POCO class representing the document:</p>

<pre><code>public class Event 
{
    public Guid EventId { get; set;}
    public DateTime ReceivedAt { get; set;}
    public string Body { get; set; }
}
</code></pre>

<p>If my code receives an event that it's already seen (based on the <code>EventId</code>) I want to <strong>only update the <code>Body</code> field</strong> and maintain the original value of <code>ReceivedAt</code> / <code>EventId</code>. If it can't find a match for the document based on <code>EventId</code> I want the document to be inserted.</p>

<p>Currently I'm using <code>ReplaceOneModel&lt;Event&gt;</code> however this updates all fields when upserting:</p>

<pre><code>var model = events.Select(
    e =&gt; new ReplaceOneModel&lt;Event&gt;(Builders&lt;Event&gt;.Filter.Where(
        x =&gt; x.EventId == e.EventId), e) { IsUpsert = true });

await collection.BulkWriteAsync(model);
</code></pre>

<p>Any help is much appreciated!</p>

