embedfield:
User is added to mongoDB database after registration despite "username" chosen already existing<p>I am developping a web app with the MERN stack. </p>

<p>On Postman or on my front-end form, when I register a user with an existing email, the user is not added to database. I use the same logic to check if the username picked by the user is already taken. If it's taken, the error message is dispatched but the user is still added to the database. </p>

<p>In the User model, the field Username is unique, just like the field Email. </p>

<p>My register route:</p>

<pre><code>const express = require("express");
const router = express.Router();
const User = require("../../models/User");
const { check, validationResult } = require("express-validator");
const bcrypt = require("bcryptjs");
const jwt = require("jsonwebtoken");
const config = require("config");

// @route GET register
// @desc Register
// @access Public
router.get("/", (req, res) =&gt; {
    res.send("Create an account");
});

// @route POST register
// @desc Register
// @access Public
router.post(
    "/",
    [
        check("email", "Please, include a valid email.").isEmail(),
        check(
            "password",
            "Please, enter a password with 6 or more characters"
        ).isLength({ min: 6 }),
        check("username", "Please, include a valid username.")
            .not()
            .isEmpty()
    ],
    async (req, res) =&gt; {
        const errors = validationResult(req);
        if (!errors.isEmpty()) {
            return res.status(400).json({ errors: errors.array() });
        }

        const {
            email,
            password,
            birthdate,
            birthplace,
            sun,
            username,
            date,
            is_paying
        } = req.body;

        try {
            // See if user exists
            let user = await User.findOne({ $or: [{ username }, { email }] });
            if (user) {
                res.status(400).json({ errors: [{ msg: "User already exists" }] });
            }

            // Create new user from User Model
            user = new User({
                email,
                password,
                birthdate,
                birthplace,
                sun,
                username,
                date,
                is_paying
            });

            // Encrypt password
            const salt = await bcrypt.genSalt(10);
            user.password = await bcrypt.hash(password, salt);

            // Add user to database
            await user.save();

            // Return JWT
            const payload = {
                user: {
                    id: user.id
                }
            };

            jwt.sign(
                payload,
                config.get("jwtSecret"),
                { expiresIn: 360000 },
                (err, token) =&gt; {
                    if (err) throw err;
                    res.json({ token });
                }
            );
        } catch (err) {
            console.error(err.message);
            res.status(500).send("Server Error");
        }
    }
);

module.exports = router;
</code></pre>

<p>My register action :</p>

<pre><code>// REGISTER USER
export const register = ({
    email,
    password,
    birthdate,
    gender,
    sun,
    username
}) =&gt; async dispatch =&gt; {
    const config = {
        headers: {
            "Content-Type": "application/json"
        }
    };

    const body = JSON.stringify({
        email,
        password,
        birthdate,
        gender,
        sun,
        username
    });

    try {
        const res = await axios.post("/register", body, config);
        dispatch({
            type: REGISTER_SUCCESS,
            payload: res.data
        });
        dispatch(loadUser());
    } catch (err) {
        const errors = err.response.data.errors;
        if (errors) {
            errors.forEach(error =&gt; dispatch(setAlert(error.msg, "danger")));
        }

        dispatch({
            type: REGISTER_FAIL
        });
    }
};
</code></pre>

